package algorithm.string;

import java.util.HashMap;

/*
给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。

示例 1:

输入: s = "anagram", t = "nagaram"
输出: true

示例 2:

输入: s = "rat", t = "car"
输出: false

说明:
你可以假设字符串只包含小写字母。

进阶:
如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？

 */
public class IsAnagram {
    public static void main(String[] args) {
        String s = "anagram", t = "nagaram";
        String s1 = "rat", t1 = "car";
        String s2="aabbbb",t2 = "aaaabb";
        String s3="";
        String t3="";
        System.out.println(solution(s3,t3));

    }
/*
思路 hashMap key,次数,一致
执行用时 :76 ms, 在所有 Java 提交中击败了5.44% 的用户
内存消耗 :43.2 MB, 在所有 Java 提交中击败了15.17%的用户
性能为什么这么慢？
第一个：相同思路的比我快的，maps.put(s.charAt(i),maps.get(s.charAt(i))+1)
用的是maps.put(s.charAt(i),maps.getOrDefault(s.charAt(i),0)+1).
第二个：快的算法直接使用数组下标方式来处理。下标为char-'a'的值，最终比较数组。我一开是也想到了用-'a'的方式，但是想的是1左移和逻辑运算。而放弃了。
 */
    public static boolean solution(String s, String t){
        if(s.length()!=t.length()){
            return false;
        }
        //申明map
        HashMap<Character,Integer> maps=new HashMap<>();
        HashMap<Character,Integer> mapt=new HashMap<>();
        //放数据
        for(int i=0;i<s.length();i++){
            /*
            第一个：相同思路的比我快的，maps.put(s.charAt(i),maps.get(s.charAt(i))+1)
            用的是maps.put(s.charAt(i),maps.getOrDefault(s.charAt(i),0)+1).
            执行用时 :57 ms, 在所有 Java 提交中击败了16.09% 的用户
            内存消耗 :43.6 MB, 在所有 Java 提交中击败了13.02%的用户
             */
            maps.put(s.charAt(i),maps.getOrDefault(s.charAt(i),0)+1);
            mapt.put(t.charAt(i),mapt.getOrDefault(t.charAt(i),0)+1);
        }
        //查数据
        for(Character key:maps.keySet()){
            if(mapt.containsKey(key)){
                //Integer的自动解包没有起作用？必须用equals才能比较。只能说解包是在定义的时候做的事，用的时候不管？
                if(maps.get(key)-mapt.get(key)!=0){
                    return false;
                }
            }else {
                return false;
            }
        }
        return true;
    }
    /*
    更优算法
    执行用时 :8 ms, 在所有 Java 提交中击败了80.60% 的用户
    内存消耗 :36.9 MB, 在所有 Java 提交中击败了96.11%的用户
     */
    public static boolean solution2(String s, String t){
        if (s.length()-t.length()!=0){
            return false;
        }
        int[] letters=new int[26];
        for(int i=0;i<s.length();i++){
            letters[s.charAt(i)-'a']++;
            letters[t.charAt(i)-'a']--;
        }
        for(int l:letters){
            if(l!=0){
                return false;
            }
        }
        return true;
    }
}
